            "created": "2014-02-04T17:01:37.000+0900",
            "description": "[UI] POD내 HOST정보 입력 시 랙 내 위치 ITAM참조 금지\r\n\r\nPOD내에서 HOST정보를 입력 할 때\r\n랙 내 위치를 15번에서 시작하면 입력 창에서도 처음에는 시작위치/끝위치를 15번으로 유지하고 있다\r\n\r\n이 상태에서 바코드를 입력하고 정보를 조회하면 다른 스펙정보들이 채워지면서, \r\n랙 내 위치 정보는 리셋되어 버리는 문제점이 있다\r\n\r\n원인은 UI상에서 랙 내 정보를 ITAM 연동 DB에서 가져와서 뿌려주는데,\r\n실제 우리가 참고하고 있는 ITAM DB에서 Rack 위치라는 것은 Rack내 위치 정보가 아닌\r\n상면 위치 정보이다\r\n\r\n따라서, 이 부분은 UI상에서  ITAM DB를 참조하지 않도록 변경한다\r\n",
