            "created": "2014-01-29T14:33:14.000+0900",
            "description": "FANme 서비스에서 변경신청을 통해 VM을 삭제 진행하고 '구축완료처리'하는 부분에서 정상적으로 처리 안되는 문제가 발생하여 DB 수작업을 진행했습니다.\r\n* application_build_result에 'COMPLETE_BUILD' 처리\r\n* application 의 status을 14로 수정\r\n\r\n수정해야 할 부분 \r\n* 삭제처리의 경우 application_build_host에 os_id, target_pod, target_host 정보를 제거한다.\r\n* DesignControllerHelper#makeServers에서 Os에 대한 null 확인 부분 보완\r\n\r\n버그 발생\r\n* ApplicationBuildHost의 Os 정보를 가지고 DesignControllerHelper에서 진행하는 과정에서 nullpointerexception 발생\r\n\r\n추가 논의될 부분\r\n* 삭제 처리된 OS에 대한 내역은 어떤방식으로 제공되는지?",
