            "description": "1. 기대상황\r\nStorage Mount 자동화를 위한 Mount Path입력은 추가 스토리지 볼륨만 노출되어야 하며,\r\nOS가 설치되어 있는 Root Volume은 노출될 필요가 없다\r\n신규 생성을 처음부터 Portal을 통해 진행한 서비스의 경우 변경 구축 시에도\r\nroot volume에 대한 mount path 입력을 요구하지 않느다\r\n\r\n2. 현재상황\r\nMigration 된 서비스에서만 발생하는 한정적인 문제로 추정\r\nMigration 된 서비스를 Portal 인프라 신청: 변경 신청을 통해 진행할 경우\r\nMount Path 누락으로 다음 단계로 진행할 수 없다\r\n사용자가 모두 Mount Path를 모두 입력할 경우 다음 단계로 진행이 가능한데,\r\n문제는 이 때 추가 스토리지 볼륨에 대해서만 mount path를 질의하는 것이 아니라\r\nRoot Volume까지 화면에 노출되어 Mount Path입력을 요구한다\r\n",
