            "created": "2014-01-27T11:56:34.000+0900",
            "description": "1. 현재상황\r\nCloudPlatform: 신규 프로세스 / 변경 프로세스 모두 지원\r\nOpenstack: 신규 프로세스만 지원 / 변경 프로세스 지원 전\r\n\r\n2. 테스트 결과\r\n현재 Openstack 변경 프로세스를 공식적으로 지원한 상황은 아니지만,\r\n추가 스토리지에 대한 부분에 대해서만 테스트케이스에 포함하여 확인하기로 함.\r\n테스크 케이스는 기존에 만들어진 VM에 대한 Service Offering 변경 없이, \r\n추가 스토리지만 요청하여 변경 구축하는 Case.\r\n\r\n기대결과는 VM(Hostname: A)은 그대로 있고, 여기에 추가 스토리지만 할당되어야 하나,\r\n실제 결과는 동일한 hostname의 VM(A)가 하나 더 생성되고, 여기에 기존 VM에 할당된 스토리지+추가 스토리지까지 덧붙여 만들어짐\r\n\r\n3. 수정된 기대 결과\r\n동일한 Hostname의 VM이 만들어져서는 안됨.\r\n기존 VM에 이미 할당된 Storage volume은 변경 없이, 신규로 추가된 Storage Volume만 추가되어야 함\r\n\r\n4. 기타\r\nStorage를 추가하는 case만 가정하며, 이미 만들어진 Storage Volume을 삭제하는 경우는 생각하지 않아도 됨\r\n\r\n",
