            "customfield_11100": ["com.atlassian.greenhopper.service.sprint.Sprint@66cf070d[name=Sprint 15,closed=false,startDate=2014-01-27T18:50:00.000+09:00,endDate=2014-02-13T18:50:00.000+09:00,completeDate=<null>,id=42]"],
