            "created": "2014-01-24T15:14:26.000+0900",
            "description": "As-Is: VM Storage=> Hypervisor가 할당해 주는 Nexenta Storage(single)\n                    Shared Volume구성은 Hypervisor가 처리하지 못하며,\n                    Nexenta의 경우에도 자동 할당 불가\n         Dedci Storage => single, Shared 관계없이 Hitachi Storage할당\n\nto-be: VM일 경우에도 Shared Volume구성 신청 시에는 자동화 구성을 위해\n        Hitachi Storage로 분기되어 명령이 갈 수 있게 할 것\n\n(2)에서 진행 내용\n* VM이 사용하는 Shared Stroage Provisioning UI 개발 \n",
