            "description": "*SW 설치현황 페이지의 표현정보 추가*\r\n•\tsw 버전 정보 컬럼 추가\r\n•\tsw가 설치된 vm/ded의 os 종류, 버전 정보 추가\r\n•\tvm의  소켓수(중요) → vm이 속한 장비의 vcore수 정보 추가\r\n\r\n*신규 기능 추가/기능 개선*\r\n•\t목록 엑셀 다운로드 기능 (검색결과 or 전체목록 모두)\r\n•\t목록 정렬 변경 : 최신 것이 상단에 나타나도록 변경 →현재 소팅 기준이 없는 것 같다(매번 로딩시 다른 목록이 보임)\r\n•\ttotal 개수 상단에 표현 \r\n\r\n*검색기능 강화*\r\n•\tsw로 검색시 드롭다운 박스 목록에서 선택할 수 있으면 좋을 듯\r\n\r\n\r\n*화면설계서*\r\n- http://wiki.ktcloudware.com/pages/viewpage.action?pageId=30057602\r\n- 1/27 파일 참조\r\n\r\n*마크업 파일*\r\n- http://dev.ktcloudware.com/IPC2/2014/report_sw.html\r\n",
