            "description": "리소스 상태를 추가하여 데이터의 삭제 등으로 정보가 완전히 없어지는 것을 방지한다. \nStorage를 우선적으로 고려하여 진행해 본다.\n\nStorage에 Status 컬럼을 추가하여 Status 상태를 기준으로 조회하도록 수정한다. \nStatus는 ACTIVE, DELETE (BUIDING, INACTIVE 상태는 나중에)\nStatus 변경 시간,\nStatus 변경자(사번)\n\n공통으로 사용할 수 있는 Status를 만들어서 처리한다. ",
