            "created": "2014-01-20T11:55:56.000+0900",
            "description": "1. 현재상황\r\n   설계완료 후 구성안 수락시 재원산정 프로세스(CAPEX, OPEX)산정으로 Status 이동\r\n   사업부서는 CAPEX, OPEX가 둘 다 완료되어야 재원산정 과정이 완료되 것으로 표시\r\n   내부처리는 CAPEX /OPEX 처리하는 부서가 각기 달라 각각 처리\r\n     => 둘 중 하나만 되지 않아도, 재원산정 과정이 완료되지 않음\r\n\r\n2. 변경\r\n\r\n   설계 완료 후 구성안 수락 시 OPEX는 자동으로 산정:\r\n   사람이 메뉴에 접근하여 확인하기 버튼 클릭하는 프로세스 생략\r\n\r\n   재원산정 결과에서는 지금과 동일하게 CAPEX/OPEX를 사업부서가 모두 볼 수 있게 유지(변경사항없음)\r\n",
