            "created": "2014-01-15T13:18:57.000+0900",
            "description": "ㅇ IPC CloudStack 가용 VM 수\r\n용도\t유형\t운용 POD 수\t가용 VM 수\r\n운용(Production)\tKTIS_V2\t6\t2\r\n\tKTIS_V3\t4\t5\r\n\tDMZ_V2\t4\t78\r\n\tDMZ_V3\t3\t50\r\n개발(DEV)\tKTIS\t5\t30\r\n\tDMZ\t3\t76\r\n테스트(TB)\tKTIS\t5\t16\r\n\tDMZ\t5\t78\r\n** 가용VM: 여유자원(85%)을 반영하여 VM당 10vCore, 10GB_MEM, 600GB_STG 적용\r\n\r\nㅇ 현재 POD를 환경별/Tier별로 나누어 현황 파악 필요\r\nㅇ 남아있는 리소스를 분석하여 기준 VM스펙(CPU, MEM, Storage)를 입력하였을 때\r\n   개별 환경/Tier별로 수용가능한 VM개수 파악\r\n   => 투자 및 예산배정을 위해 Backdata로 상위부서에서 요청함.\r\n      클라우드추진본부 입장에서는 예산 확보를 위해 어떻게든 만들어주여야 하는 내용\r\n\r\nㅇ 기준VM입력은 아래와 같은 형태로 한다\r\n\r\n\r\n\r\n--\r\n*화면설계서*\r\n- http://wiki.ktcloudware.com/pages/viewpage.action?pageId=30057600\r\n- 화면설계 문서 업로드(첨부 위키의 0128 문서 p. 6)\r\n\r\n*마크업 링크*\r\n- http://dev.ktcloudware.com/IPC2/2014/infra_zone_detail.html\r\n",
