            "customfield_11003": "14607",
            "aggregatetimeoriginalestimate": 86400,
            "customfield_11005": null,
            "customfield_11004": null,
            "updated": "2014-02-11T14:04:45.000+0900",
            "created": "2014-01-09T17:49:32.000+0900",
            "description": "1. 현재상황\r\n   인프라 관리-Zone/POD 관리 메뉴 클릭 시 38개 Zone 현황이 노출\r\n   실제 업무가 C-node나 Switch를 찾아 정보를 확인하는 것이 목적일 경우\r\n   어느 Zone에 소속되어 있는지 찾는 것부터 Burden이 됨\r\n\r\n2. 기능추가\r\n   첨부파일과 같이 메뉴 상단에 Fast Search 기능을 개발\r\n   fast serach 기능은 아래와 같은 구성이 된다\r\n\r\n   (Type: 상시노출)(Second Type: 상시노출)(입력 박스) (검색버튼)\r\n\r\n2-1. Type은 아래와 같이 구성된다\r\n   POD , C-node, S-node, M-node, Storage, L2 Switch, L3 Switch, L4 switch: \r\n   해당내역은 POD내 장비 등록을 할 때 나오는 Type과 일치하면 됨. 이 내역에 POD만 추가.\r\n\r\n2-2. Type 선택 시 Second Type 은 아래와 같다\r\n   POD선택시: POD명, 위치\r\n   C-node선택 시: Host이름, 바코드, MGMT IP\r\n   그 외: 바코드\r\n\r\n3. 기대결과\r\n   검색버튼을 누르면 아래와 같은 결과가 나와야 한다\r\n   POD 선택 후 검색: 새로운 탭(반드시 새로운 탭)에 검색한 POD정보 화면이 노출(첨부 화면 2번 참고)\r\n   그 외 검색: 새로운 탭에 POD정보 화면이 노출되고, 검색한 host에 대해 highlight되어 노출9첨부화면 3번 참고) \r\n\r\n\r\n\r\n--\r\n*화면설계*\r\n- 아래 wiki의 0203문서 p. 7~10\r\n- http://wiki.ktcloudware.com/pages/viewpage.action?pageId=30057600 \r\n\r\n*마크업*\r\n- http://dev.ktcloudware.com/IPC2/2014/infra_zone_search.html\r\n- 실위치 항목은 금일(2/6)중 드롭다운 리스트로 변경될 예정",
