            "customfield_11004": null,
            "updated": "2014-02-05T22:01:56.000+0900",
            "created": "2013-12-19T15:52:52.000+0900",
            "description": "서비스명 : ipc-sprint13-openstack-01\r\n\r\nopenstack VM 프로비져닝 할때 10개 이상의 스토리지를 가지고 시도 하는 경우 에러 발생함\r\n\r\n\r\n5개의vm에 각각 스토리지를 6개 , 5개, 1개 1개 2개씩 붙여서 프로비저닝을 하면\r\n\r\n첫번째 vm은 생성이 되지만 이후의 vm은 \r\n\r\nVloumeLimitexceeded : maximum number of volumes allowed exceeded 발생함",
